import AsyncStorage from "@react-native-async-storage/async-storage";
import Servidores from "../../pages/Servidores"
const servers = async (Servidores)=>{
    AsyncStorage.getItem('Ararangua');
    AsyncStorage.getItem('Criciuma');
    switch (Servidores) {
        case 'Ararangua': return 'ti.ararangua.sc.gov.br:10000';
        case 'Criciuma': return 'ti.criciuma.sc.gov.br:00000';

    }
}
export default servers;
